CREATE TABLE orden_compra(
	idorden smallint(4) NOT NULL AUTO_INCREMENT,
	anio smallint(4),
	numero smallint(4),
	fecha date,
	idempresa smallint(4) NOT NULL,
	idcentro smallint(4) NOT NULL,
	idproveedor smallint(4) NOT NULL,
	idtipopago smallint(4) NOT NULL,
	idmediopago smallint(4) NOT NULL,
	idtipomoneda smallint(4) NOT NULL,
	observaciones varchar(500),
	tipo_cambio decimal(18,4),
	importe decimal(20,4),
	impuesto decimal(20,4),
	total decimal(20,4),
	activo char(1) DEFAULT '1',
	PRIMARY KEY (idorden),
	FOREIGN KEY (idempresa) REFERENCES empresa (idempresa) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (idcentro) REFERENCES centro_costos (idcentro) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (idproveedor) REFERENCES proveedor (idproveedor) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (idtipopago) REFERENCES tipo_pago (idtipopago) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (idmediopago) REFERENCES medio_pago (idmediopago) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (idtipomoneda) REFERENCES tipo_moneda (idtipomoneda) ON DELETE CASCADE ON UPDATE CASCADE)ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;

